<!DOCTYPE html><html><head>
    <title>Math Edit</title>

    <link rel="canonical" href="https://kasperpeulen.github.io/mathedit">

    <!--JS scripts-->
    <script type="text/javascript" src="https://cdn.mathjax.org/mathjax/latest/MathJax.js?delayStartupUntil=configured"></script>
    <script src="https://cdn.firebase.com/js/client/2.3.2/firebase.js"></script>

    <!-- Dart scripts -->
    
    <script defer="" src="main.dart.js"></script>

    <!--Style sheets-->
    <link rel="stylesheet" href="//maxcdn.bootstrapcdn.com/bootstrap/3.3.6/css/bootstrap.min.css">
    <link rel="stylesheet" href="styles.css">

  </head>
  <body class="tex2jax_ignore">
    <app>
      <div class="loader">Loading...</div>
    </app>

    <script>
      if ('serviceWorker' in navigator) {
        navigator.serviceWorker.register('js/service_worker.js')
            .then(function (registration) {
              console.log('ServiceWorker registration successful with scope: ', registration.scope);
            }).catch(function (err) {
          console.log('ServiceWorker registration failed: ', err);
        });
      }
    </script>

  
</body></html>
